import React from 'react'
import './signIn.css'

const SignIn = () => {
  return (
    <div 
    style={{
        display: 'flex', 
        justifyContent: 'center', 
        alignItems: 'center', 
        height:'90vh'
        }}
    >
        <h1 className='h1-txtSignIn'>SignIn</h1>
    </div>
  );
};

export default SignIn
